import Navbar from './Navbar'
import Footer from './Footer'
import Content from './Content'
import Images from './Images'
import square from './square.jpeg'

function App() {
  return (
    <div className='App'>
      <Navbar/>
      <Content/>
      <div class="grid-item"><img src={square} className="Thumbnail"  /></div>
      <Footer/>

    </div>

  );
}

export default App;
